INSERT INTO `posts` VALUES (32,17,1,'2021-02-05 17:15:08',19,'comment','<t><p>If a student has difficulties on a Math subject, he can do a self-need assessment to identify his difficulties. In the case that he fails a given question, videos and teaching material are available to be explored.</p></t>',NULL,NULL,NULL,NULL,'162.158.114.137',0,1),(34,18,1,'2021-02-08 14:38:30',22,'comment','<t><p>Wondering what other game I could offer my students during lectures. I tried Kahoot program, but it\'s not a game actually, but like it.</p></t>','2021-02-08 14:39:28',22,NULL,NULL,'172.69.190.55',0,1),(35,18,2,'2021-02-08 18:58:44',27,'comment','<t><p>One of my colleagues use Kahoot as a game-based student response system. I think it could be used to repeat some topics by answering questions in real-time, obtain statistics and assess students\' level of understanding. Other similar tool is Mentimeter. For example, it could be used for remote teaching, since one of its functions is to track how many students are connected to a presentation.</p></t>',NULL,NULL,NULL,NULL,'162.158.102.101',0,1),(36,19,1,'2021-02-12 10:46:59',35,'comment','<t><p>Just wondering if anyone has any tips for best tools to assist on-line teaching of maths? #tablet computers #On-line tools</p></t>',NULL,NULL,NULL,NULL,'141.101.76.101',0,1),(37,19,2,'2021-02-12 14:41:28',27,'comment','<r><p>For me, WACOM One Creative Pen Display is the best one  <URL url=\"https://www.wacom.com/en-tw/products/pen-displays/wacom-one\">https://www.wacom.com/en-tw/products/pen-displays/wacom-one</URL></p></r>',NULL,NULL,NULL,NULL,'172.69.190.67',0,1),(38,19,3,'2021-02-17 17:45:23',35,'comment','<r><p>@<EMAIL email=\"kristina.sutiene@ktu.lt\">kristina.sutiene@ktu.lt</EMAIL>#37 Thanks for the tip Kristina. Is the WACOM compatible with other platforms?</p>\n</r>',NULL,NULL,NULL,NULL,'162.158.93.238',0,1),(39,20,1,'2021-02-19 16:03:03',21,'comment','<r><p>Hello All,<br/>\nI came across a few online web sites that had some nice imagery for teaching maths. Some of the sections start at a basic level but build up to more complex resources.<br/>\nHope they are of help.<br/>\nwww.homeschoolmath.net<br/>\n<URL url=\"https://www.skillsyouneed.com/numeracy-skills.html\">https://www.skillsyouneed.com/numeracy-skills.html</URL><br/>\nwww.freemathhelp.com</p></r>',NULL,NULL,NULL,NULL,'141.101.76.149',0,1),(40,19,4,'2021-02-23 11:37:44',21,'comment','<t><p>I have just started using the WACOM One Creative Pen Display. It is very user friendly and works well for drawings and images as well.</p></t>',NULL,NULL,NULL,NULL,'141.101.98.89',0,1),(41,20,2,'2021-02-23 11:43:09',21,'comment','<t><p>www.derivative-calculator.net is a handy website for quick checks on differentiation examples. It will also allow you to export the results in LaTeX, Maxima or for online calculators so it can speed up the typing a bit.</p></t>',NULL,NULL,NULL,NULL,'141.101.98.89',0,1),(42,20,3,'2021-02-23 11:51:11',21,'comment','<t><p>The resources section of UC Davis has a number of calculus resources. <br/>\nwww.math.ucdavis.edu/resources/learning/calculus-help/</p></t>',NULL,NULL,NULL,NULL,'141.101.98.197',0,1),(43,20,4,'2021-02-23 11:53:55',21,'comment','<t><p>Interactive Mathematics has a nice spread of resources. Some very basic areas of maths but on upto more complex aspects. The layout and structure of the tools are fairly user friendly<br/>\nwww.intmath.com</p></t>',NULL,NULL,NULL,NULL,'141.101.98.197',0,1),(44,21,1,'2021-03-02 13:55:06',32,'comment','<t><p>Mathematics for Engineering in light of Galileo Galilei : \"Mathematics is the language with which God has written the universe\". How to understand this idea nowadays? Is Mathematics everywhere around us?</p>\n</t>',NULL,NULL,NULL,NULL,'141.101.105.29',0,1),(45,21,2,'2021-03-03 10:48:54',35,'comment','<r><p>If we can spark that curiosity in the students it may inspire them to study Maths more consciously. I love the Fibonacci sequence <URL url=\"https://www.mathsisfun.com/numbers/nature-golden-ratio-fibonacci.html\">https://www.mathsisfun.com/numbers/nature-golden-ratio-fibonacci.html</URL></p>\n</r>',NULL,NULL,NULL,NULL,'141.101.104.104',0,1),(46,22,1,'2021-03-03 10:55:09',35,'comment','<r><p>Some interesting Math simulations available from the University of Colorado <URL url=\"https://phet.colorado.edu/en/simulations/browse\">https://phet.colorado.edu/en/simulations/browse</URL><br/>\nJust wonder if any of you have used them?</p></r>',NULL,NULL,NULL,NULL,'141.101.104.126',0,1),(47,20,5,'2021-03-03 12:25:05',21,'comment','<r><p>I have been working on <STRONG><s>**</s>www.canva.com<e>**</e></STRONG> to develop some infographics around some Maths topics. MS Viso is good too but Canva have some nice templates and ideas. Any one else come across these?</p></r>',NULL,NULL,NULL,NULL,'141.101.104.104',0,1),(48,21,3,'2021-03-03 12:33:50',21,'comment','<t><p>I think that idea of capturing the students imagination is vital. I try to use every day examples of Math to get the students to engage with the application and then link in the concepts and theory of Maths around that. For weaker students if they see a purpose to the Maths it often helps them to engage,</p></t>',NULL,NULL,NULL,NULL,'141.101.104.104',0,1),(49,22,2,'2021-03-03 14:31:41',21,'comment','<t><p>Mathhelp.com have a number of simulation too. At college level it is mainly Algebra but they have some nice ones to introduce a topic at 2nd level too.</p></t>',NULL,NULL,NULL,NULL,'162.158.111.88',0,1),(50,23,1,'2021-03-04 09:59:15',24,'comment','<r><p>If you are interested in teaching matematics to students with learning disabilites you may find interesting material on the webpage of the European Project <URL url=\"url\"><s>[</s>https://smild.pixel-online.org/<e>](url)</e></URL></p> \n</r>','2021-03-04 09:59:37',24,NULL,NULL,'162.158.89.134',0,1),(51,24,1,'2021-03-04 10:08:48',24,'comment','<r><p>How to use digital resources to help activate formative assessment processes in the classroom? The attached paper deals with the exploitation of digital worksheets supported by connected classroom technologies in order to help activate formative assessment strategies, especially during class-wide activities: <URL url=\"https://link.springer.com/article/10.1007/s11858-017-0878-0\"><s>[</s>Promoting formative assessment in a connected classroom environment<e>](https://link.springer.com/article/10.1007/s11858-017-0878-0)</e></URL></p></r>','2021-04-01 16:12:27',24,NULL,NULL,'162.158.89.134',0,1),(52,25,1,'2021-03-04 15:51:59',951,'comment','<t><p>Two books which I find very useful and which in my opinion take a very clear and logical approach to the application of maths are:  Construction Mathematics Virdi &amp; Baker ISBN  978 0750667920 and Engineering Mathematics Bird ISBN 978 1138673595.  These are relevant to students who are studying on Built Environment Courses in particular.</p></t>',NULL,NULL,NULL,NULL,'141.101.98.43',0,1),(53,23,2,'2021-03-04 17:07:19',19,'comment','<t><p>Very useful Project. Thanks Arvid!</p></t>',NULL,NULL,NULL,NULL,'172.68.102.155',0,1),(54,26,1,'2021-03-04 17:11:54',19,'comment','<r><p>Present your research work at the session: TiEE - Trends in Engineering Education on  OL2A:  International Conference on Optimization, Learning Algorithms and Applications(<URL url=\"http://ol2a.ipb.pt/\">http://ol2a.ipb.pt/</URL>) - an Online Conference - July 19 to 21, 2021.</p></r>',NULL,NULL,NULL,NULL,'162.158.155.221',0,1),(55,26,2,'2021-03-04 21:33:24',19,'discussionTagged','[[16],[16,45]]',NULL,NULL,NULL,NULL,NULL,0,1),(56,21,4,'2021-03-04 22:38:43',26,'comment','<t><p>I enjoyed reading \'The Maths of Life and Death\' by Marcus Du Sautoy. I found many useful stories to grab students attention in this book.</p></t>',NULL,NULL,NULL,NULL,'162.158.158.222',0,1),(57,19,5,'2021-03-04 22:44:10',26,'comment','<r><p>Thank you, great tips @<EMAIL email=\"rita.scully@lit.ie\">rita.scully@lit.ie</EMAIL>#40  and @<EMAIL email=\"kristina.sutiene@ktu.lt\">kristina.sutiene@ktu.lt</EMAIL>#37 re: WACOM One Creative Pen Display.</p>\n</r>',NULL,NULL,NULL,NULL,'162.158.158.222',0,1),(58,21,5,'2021-03-05 10:31:17',951,'comment','<r><p>There are some excellent inspirational Ted talks and videos which shows the use of maths in everyday life.  I particularly like the series by Eddie Woo on the use of Maths in the construction of the Sydney Opera House <URL url=\"https://youtu.be/C-U_MeBekJw\">https://youtu.be/C-U_MeBekJw</URL> Eddie Woo Maths of Sydney Opera House  Geometry.  I think if students see practical examples of the application of Maths, it can spark their interest and then lead them to further investigate Maths as a way to solve problems and create structures which would not otherwise possible.  Buildings are man made structures but maths can also be found in nature.</p> </r>',NULL,NULL,NULL,NULL,'172.69.55.19',0,1),(59,20,6,'2021-03-05 10:57:08',951,'comment','<r><p>There are many videos available on You Tube for teaching various topics within Mathematics.  I find the videos which relate Maths topics to the real to be particular beneficial. One I particularly like is <URL url=\"url\"><s>[</s><e>](url)</e></URL> \"Geometry of Architecture\" produced by Faculdade de Ciencias Universidade de Lisboa, not just for it\'s application of maths to actual buildings but for the beautiful artists impressions also, making the video visually attractive and therefore engaging. <URL url=\"https://youtu.be/z2Fb0R2EYo4\">https://youtu.be/z2Fb0R2EYo4</URL></p></r>',NULL,NULL,NULL,NULL,'141.101.99.190',0,1),(60,28,1,'2021-03-17 13:40:16',127,'comment','<t><p>I wonder if your students are actively using the tests created by you.</p></t>',NULL,NULL,NULL,NULL,'162.158.183.202',0,1),(61,28,2,'2021-03-17 17:59:49',27,'comment','<t><p>Sometimes I need to motivate them, but generally self-assessment tests are very good tool for activity-based learning.</p></t>',NULL,NULL,NULL,NULL,'162.158.183.202',0,1),(62,29,1,'2021-03-24 09:44:22',35,'comment','<t><p>Just wondering if any of you are members of any associations, either nationally or internationally? Could you recommend any to your colleagues? #association #collaboration #goodpractice</p></t>',NULL,NULL,NULL,NULL,'141.101.98.43',0,1),(63,19,6,'2021-03-24 16:11:00',29,'comment','<t><p>I have been using the wacom graphics tablet since October and I find it invaluable for teaching Maths. Very easy to use.</p> </t>',NULL,NULL,NULL,NULL,'172.69.54.192',0,1),(64,22,3,'2021-03-24 16:35:02',29,'comment','<r><p>Those simulations from University of Colorado look great. I will definitely use them. One simulation I use for Statistics and the Sampling Distribution of the Mean is <URL url=\"https://onlinestatbook.com/stat_sim/sampling_dist/index.html\">https://onlinestatbook.com/stat_sim/sampling_dist/index.html</URL>.</p> </r>',NULL,NULL,NULL,NULL,'141.101.76.69',0,1),(65,20,7,'2021-03-24 16:46:51',29,'comment','<r><p>Other useful resources are <URL url=\"https://www.mathsisfun.com/\">https://www.mathsisfun.com/</URL>, a great resource up for elementary maths, full of useful illustrations and simulations. Also, MASH from University of Sheffield has a lot of Maths and Stats resources available. <URL url=\"https://www.sheffield.ac.uk/mash/resources/maths-resources\">https://www.sheffield.ac.uk/mash/resources/maths-resources</URL></p> </r>',NULL,NULL,NULL,NULL,'141.101.76.69',0,1),(66,19,7,'2021-03-28 12:31:05',951,'comment','<t><p>I am using is a webcam mounted to a timber bridge construct (timber bridge devised and constructed by a colleague from the Built Environment Dept).  It allows me to use pen and paper to write maths and draw diagrams.  Very low tech but it works! I can also record as I write and draw.</p></t>',NULL,NULL,NULL,NULL,'141.101.76.61',0,1),(67,28,3,'2021-03-28 12:37:15',951,'comment','<t><p>I find  majority of students can be reluctant to use tests unless grades are being awarded for them. This is especially so if they are required to complete a considerable amount of assessments for various modules.</p></t>',NULL,NULL,NULL,NULL,'141.101.105.159',0,1),(68,28,4,'2021-03-30 07:16:53',22,'comment','<t><p>I would like them to exercise more often but usually need encouragement. Yet, when they try this tool, they use it more actively yourself.</p></t>',NULL,NULL,NULL,NULL,'162.158.202.237',0,1),(69,25,2,'2021-03-30 07:23:50',22,'comment','<t><p>For Statistics I recommend: First Course in Statistics, by James McClave, Terry Sincich</p></t>',NULL,NULL,NULL,NULL,'162.158.183.108',0,1),(70,23,3,'2021-03-30 08:36:58',95,'comment','<t><p>Now in the webpage one can also find the Guidelines</p></t>',NULL,NULL,NULL,NULL,'172.69.55.209',0,1),(71,23,4,'2021-03-30 08:38:25',95,'comment','<t><p>These are the last days for the Project, but we hope to go on working on it</p>\n</t>',NULL,NULL,NULL,NULL,'172.69.55.209',0,1),(72,28,5,'2021-03-30 09:20:20',24,'comment','<t><p>It seems to me that they use tests only when you create for them a special test for a special argument, but not as a training tool, or at least not in a regular way. It would be interesting to know if they use it more regularly when they approach to an exam...</p></t>',NULL,NULL,NULL,NULL,'188.114.102.35',0,1),(73,24,2,'2021-03-30 11:53:07',35,'comment','<r><p>@<EMAIL email=\"perego@dima.unige.it\">perego@dima.unige.it</EMAIL>#51 Hi Arvid, I\'m interested in the digital resources to help formative assessment but the link appears to be broken. Can you check it please?</p></r>',NULL,NULL,NULL,NULL,'141.101.99.26',0,1),(74,30,1,'2021-03-30 15:02:58',32,'comment','<r><p>I invite you to visit the site <URL url=\"https://www.themathdoctors.org/tag/curiosity/\">https://www.themathdoctors.org/tag/curiosity/</URL> to find interesting problems!</p> </r>',NULL,NULL,NULL,NULL,'141.101.77.100',0,1),(75,31,1,'2021-03-30 15:14:12',32,'comment','<r><p>Can you solve these 8 problems? &#128516; <br/>\n<URL url=\"https://www.theguardian.com/science/alexs-adventures-in-numberland/2014/oct/21/martin-gardner-mathematical-puzzles-birthday\">https://www.theguardian.com/science/alexs-adventures-in-numberland/2014/oct/21/martin-gardner-mathematical-puzzles-birthday</URL></p> </r>','2021-03-30 15:19:11',32,NULL,NULL,'141.101.105.159',0,1),(76,32,1,'2021-03-30 15:16:21',32,'comment','<t><p>Can you solve these 8 problems?</p></t>',NULL,NULL,NULL,NULL,'141.101.76.69',0,1),(77,33,1,'2021-03-30 18:11:52',19,'comment','<t><p>Share here your experiences with MathE Platform. Tell us differents ways to use MathE platform!</p></t>','2021-03-30 18:13:20',19,NULL,NULL,'172.68.102.121',0,1),(78,28,6,'2021-03-30 18:18:42',245,'comment','<t><p>I think it\'s normal that students get more active before exams, even though we would all prefer their study process being more homogeneous... Last semester I mentioned that some exam questions will be similar in style to the questions in the self assessment test - and suddenly I started getting comments and questions about those tests, that were on the course webpage since the start of the semester. I still think it can a nice tool for revising, even if only used just before an exam.</p></t>',NULL,NULL,NULL,NULL,'162.158.183.198',0,1),(79,18,3,'2021-03-30 18:53:33',245,'comment','<r><p>We are creating, with two other colleagues, an \"Escape room\" game for revising integrals, using Google Forms. All our students, in teams of 5, will have to solve a sequence of problems as fast as possible, while discussing/collaborating within a team in their Zoom Breakout room. It still remains to be seen, if they appreciate it <E>:)</E></p></r>',NULL,NULL,NULL,NULL,'162.158.222.39',0,1),(80,35,1,'2021-03-30 19:03:33',245,'comment','<t><p>What activities (beside games) do you use in your remote math courses? I am looking for something to increase the involvement of students and encourage their interaction. Often they are too shy (or lazy) to ask questions or to answer questions that I ask, so I feel a bit like talking to myself.</p></t>',NULL,NULL,NULL,NULL,'162.158.89.170',0,1),(81,30,2,'2021-03-30 19:08:38',245,'comment','<t><p>Thank you! It\'s a nice collection of problems (and discussions) indeed.</p></t>',NULL,NULL,NULL,NULL,'172.69.79.159',0,1),(82,33,2,'2021-03-30 22:03:18',19,'comment','<r><p><STRONG><s>**</s>Using MathE with international students that arrive late<e>**</e></STRONG><br/>\nActivity done at Unit Course Linear Algebra.</p>\n\n<p>Usually, IPB, receive new international students after the beginning of the math unit courses. In some situations, some math topics already were presented in the classroom. To overcome this situation, all new students perform a self-assessment on the MathE platform. If they do not have a satisfactory mark they need to analyse the teaching material present in the platform and contribute with other materials to increase the MathE material.</p>\n\n<p>All material founded by the students is validated by the teacher and after, it is submitted to the MathE Platform.</p><UPL-FILE content=\"good-practice-ipb.pdf\" size=\"838kB\" uuid=\"0ef2082d-de4d-4d91-a2e1-ba48af05b5ea\"><s>[upl-file uuid=0ef2082d-de4d-4d91-a2e1-ba48af05b5ea size=838kB]</s>good-practice-ipb.pdf<e>[/upl-file]</e></UPL-FILE>\n</r>','2021-03-31 16:30:59',16,NULL,NULL,'172.68.102.121',0,1),(83,25,3,'2021-03-31 07:30:11',245,'comment','<t><p>For Linear Algebra the books of Lay (various editions) are nice. They also have practical examples and subsections dedicated to applications for every topic.</p> </t>',NULL,NULL,NULL,NULL,'162.158.202.237',0,1),(84,33,3,'2021-03-31 10:42:57',19,'discussionTagged','[[11],[11,26]]',NULL,NULL,NULL,NULL,NULL,0,1),(85,25,4,'2021-03-31 10:44:35',19,'discussionTagged','[[10],[10,16]]',NULL,NULL,NULL,NULL,NULL,0,1),(86,35,2,'2021-03-31 12:03:00',27,'comment','<t><p>Once I have tried some experiment. I said that in the halfway of my lecture, you (students) will be randomly split into breakout rooms in pairs. One student must think of question about the delivered material, and the other student  should answer it. Two minutes has been given. Then, they summarized their experience to repeat the delivered material in this way. Also, I got some questions in order to clarify some details from my material. I liked this idea since nothing should be additionally prepared in advance.</p></t>',NULL,NULL,NULL,NULL,'162.158.183.108',0,1),(87,32,2,'2021-03-31 13:25:28',245,'comment','<t><p>Which 8 problems do you mean?</p></t>',NULL,NULL,NULL,NULL,'162.158.134.101',0,1),(88,33,4,'2021-04-01 06:25:58',27,'comment','<r><p><STRONG><s>**</s>MathE as a tool to actively gain math skills<e>**</e></STRONG><br/>\nWe have recommended MathE tool for those students who need activity based learning to gain math skills &#128516;</p> \n\n<UPL-FILE content=\"good-practice-ktu.pdf\" size=\"760kB\" uuid=\"1c0f6802-0af1-42c6-a2f4-1186f5831462\"><s>[upl-file uuid=1c0f6802-0af1-42c6-a2f4-1186f5831462 size=760kB]</s>good-practice-ktu.pdf<e>[/upl-file]</e></UPL-FILE>\n\n</r>','2021-04-01 06:26:34',27,NULL,NULL,'162.158.202.175',0,1),(89,33,5,'2021-04-01 13:56:25',35,'comment','<r><p><STRONG><s>**</s>MathE as a tool to augment classwork<e>**</e></STRONG><br/>\nWe found that a number of the videos on Probability augmented class material that had been covered. #reflection #review</p><UPL-FILE content=\"io3c-good-practice-probability.pdf\" size=\"1MB\" uuid=\"454d1f6f-0b60-4401-950c-b7d1862ad772\"><s>[upl-file uuid=454d1f6f-0b60-4401-950c-b7d1862ad772 size=1MB]</s>io3c-good-practice-probability.pdf<e>[/upl-file]</e></UPL-FILE>\n</r>','2021-04-05 13:37:52',19,NULL,NULL,'141.101.77.101',0,1),(90,33,6,'2021-04-01 14:01:39',35,'comment','<r><p><STRONG><s>**</s>Additional MathE Resources for teaching and learning Statistics<e>**</e></STRONG><br/>\nThe platform provides a high quality source of additional resources to the specific topic area.<br/>\nStudents can access these materials for further review and practice. #Statistics #review #additional resources #practice</p><UPL-FILE content=\"io3c-good-practice-lit-stats.pdf\" size=\"720kB\" uuid=\"0a726e82-b5e2-4293-9356-cedf78520baf\"><s>[upl-file uuid=0a726e82-b5e2-4293-9356-cedf78520baf size=720kB]</s>io3c-good-practice-lit-stats.pdf<e>[/upl-file]</e></UPL-FILE>\n\n</r>','2021-04-05 13:38:09',19,NULL,NULL,'141.101.99.192',0,1),(91,21,6,'2021-04-01 14:08:24',35,'comment','<r><p>There are some interesting mathematical curiosities on this link <URL url=\"https://www.byrdseed.com/mathematical-curiosities/\">https://www.byrdseed.com/mathematical-curiosities/</URL><br/>\n#motivational tools</p></r>',NULL,NULL,NULL,NULL,'141.101.99.96',0,1),(92,33,7,'2021-04-01 16:00:56',24,'comment','<r><p>We used the MathE tool both for self-assessment and for final-assessment, the first to let our students have a bit of a training activity before the exam for one week, so they could test their preparation level, and the second as an admission test for the written exam that took place the day after</p><UPL-FILE content=\"io3c-good-practice-1-unige.pdf\" size=\"222kB\" uuid=\"58a106ec-a1a9-459f-b656-574f17f6f66a\"><s>[upl-file uuid=58a106ec-a1a9-459f-b656-574f17f6f66a size=222kB]</s>io3c-good-practice-1-unige.pdf<e>[/upl-file]</e></UPL-FILE>\n<UPL-FILE content=\"io3c-good-practice-2-unige.pdf\" size=\"220kB\" uuid=\"7f1be996-3c92-4062-985a-8f137e40a0ba\"><s>[upl-file uuid=7f1be996-3c92-4062-985a-8f137e40a0ba size=220kB]</s>io3c-good-practice-2-unige.pdf<e>[/upl-file]</e></UPL-FILE>\n</r>',NULL,NULL,NULL,NULL,'188.114.102.9',0,1),(93,24,3,'2021-04-01 16:02:35',24,'comment','<t><p>it seems you are right, I have to understand why</p></t>',NULL,NULL,NULL,NULL,'188.114.102.9',0,1),(94,24,4,'2021-04-01 16:06:01',24,'comment','<t><p>Now it should be working!</p></t>','2021-04-01 16:12:54',24,NULL,NULL,'188.114.102.9',0,1),(95,35,3,'2021-04-01 16:09:56',24,'comment','<t><p>We planned some activities for remote teaching, in particular team working and preparation of brief talks on subjects they could choose among a list we prepared, and when they have to do something in first person, then they like to interact and don\'t seem shy at all, but if you ask them to interact while someone else is doing it, then they just keep silent, and especially they don\'t like to open their cam</p></t>',NULL,NULL,NULL,NULL,'188.114.102.9',0,1),(96,33,8,'2021-04-02 14:54:08',32,'comment','<r><p><STRONG><s>**</s>Using MathE for remarkable results at Math National and International Contests<e>**</e></STRONG></p>\n\n<p>We used the MathE teaching resources and video materials in the preparation of students for SEEMOUS 2020, Thessaloniki, Greece and Internet Mathematical Olympiad, organized by Ariel University, Israel, with very good results (6 medals in these competitions).</p> <UPL-FILE content=\"io3c-good-practice1-tuiasi.pdf\" size=\"783kB\" uuid=\"155c77d6-c081-43ef-88d8-e5dc23c51f46\"><s>[upl-file uuid=155c77d6-c081-43ef-88d8-e5dc23c51f46 size=783kB]</s>io3c-good-practice1-tuiasi.pdf<e>[/upl-file]</e></UPL-FILE>\n</r>',NULL,NULL,NULL,NULL,'162.158.18.247',0,1),(97,33,9,'2021-04-02 14:56:05',32,'comment','<r><p><STRONG><s>**</s>Increasing success in Math exams<e>**</e></STRONG><br/>\nFor preparing of the exams of Linear Algebra &amp; Analytic Geometry the students used the MathE teaching resources and video materials.</p> <UPL-FILE content=\"io3c-good-practice2-tuiasi.pdf\" size=\"781kB\" uuid=\"9087e0f5-91f1-433c-8179-1a4f4fe9f3c2\"><s>[upl-file uuid=9087e0f5-91f1-433c-8179-1a4f4fe9f3c2 size=781kB]</s>io3c-good-practice2-tuiasi.pdf<e>[/upl-file]</e></UPL-FILE>\n<p>Also, using Self-Need Assessment from MathE platform they increased their skills in solving problems and in the same time, they could evaluate the progress of learning.</p>   \n\n<p>According to my records from the previous years, I remarked a bigger number of students passing the exam in the first examination session and also, better results reflected in their final grades. So, the use of MathE platform was the cause of these better results.</p> </r>',NULL,NULL,NULL,NULL,'162.158.18.247',0,1),(98,33,10,'2021-04-06 07:05:10',22,'comment','<r><p>Preparation for interim settlement using a self need assessement test.</p>\n<UPL-FILE content=\"good-pr.pdf\" size=\"559kB\" uuid=\"ef95b862-5b07-4044-9679-0f08e4c0b11d\"><s>[upl-file uuid=ef95b862-5b07-4044-9679-0f08e4c0b11d size=559kB]</s>good-pr.pdf<e>[/upl-file]</e></UPL-FILE>\n</r>',NULL,NULL,NULL,NULL,'162.158.183.120',0,1),(99,26,3,'2021-04-06 18:44:27',19,'comment','<r><p><STRONG><s>**</s>Call for Papers<e>**</e></STRONG><br/>\nDeadline: 1 May 2021<br/>\nNew deadline to submit your work: session: TiEE - Trends in Engineering Education on OL2A: International Conference on Optimization, Learning Algorithms and Applications(<URL url=\"http://ol2a.ipb.pt/\">http://ol2a.ipb.pt/</URL>) - an Online Conference - July 19 to 21, 2021.</p></r>',NULL,NULL,NULL,NULL,'162.158.89.170',0,1),(100,36,1,'2021-04-08 10:40:18',20,'comment','<r><p>The paper \"Developing Tools for the e-Learning Platform MathE\" was presented at FOE 2020 international conference and you can check this at <URL url=\"url\"><s>[</s>https://conference.pixel-online.net/FOE/files/foe/ed0010/FP/6751-ICT4750-FP-FOE10.pdf<e>](url)</e></URL></p>\n</r>','2021-04-08 10:41:12',20,NULL,NULL,'141.101.69.238',0,1),(101,37,1,'2021-04-09 08:53:15',35,'comment','<r><p>Isometric drawing is a type of 3D drawing that is set out using 30-degree angles. It is a type of axonometric drawing in which the same scale is used for every axis, resulting in a non-distorted image. The way you use isometric paper is simple. It is just like regular graph paper only the boxes are angled so you automatically end up drawing in 3D. Draw your vertical lines the way you would normally do and then draw your faces and depth on the angled lines. You count boxes to keep square just like you would do on regular graph paper but here you get instant #3D #graphing #drawing<br/>\n</p>\n<H3><s>### </s>Isometric Graph paper</H3></r>','2021-04-09 08:53:56',35,NULL,NULL,'141.101.99.66',0,1),(102,26,4,'2021-04-21 08:11:37',95,'comment','<t><p>It sounds very interesting, I will send the announcement to my colleagues!</p>\n</t>',NULL,NULL,NULL,NULL,'141.101.104.104',0,1),(103,25,5,'2021-04-21 08:15:52',95,'comment','<t><p>For an Introduction course to Coding Theory I recommend \"CODING THEORY a first course\" of Van Tilborg. It is good also for students in engineering, not only for Math Students.</p> </t>',NULL,NULL,NULL,NULL,'141.101.99.148',0,1),(104,38,1,'2021-04-21 08:17:53',95,'comment','<r><p>I found it very interesting: <URL url=\"https://www.npr.org/2021/04/12/986580131/a-classroom-where-math-and-community-intersect?fbclid=IwAR0GualAs9QQymJevSveuugoCDfL143J7HdfgI9GHBME97mRSjNGdiO9I4I&amp;t=1618950673766\">https://www.npr.org/2021/04/12/986580131/a-classroom-where-math-and-community-intersect?fbclid=IwAR0GualAs9QQymJevSveuugoCDfL143J7HdfgI9GHBME97mRSjNGdiO9I4I&amp;t=1618950673766</URL><br/>\nWhat do you think about it?</p></r>',NULL,NULL,NULL,NULL,'141.101.99.148',0,1),(105,26,5,'2021-04-21 14:25:28',920,'comment','<t><p>I have already had the opportunity to see the content of the conference, which greatly challenges the participation and sharing of mathematical content, optimization and applications. I will certainly make an effort to participate actively. I will share with more colleagues!</p></t>',NULL,NULL,NULL,NULL,'108.162.229.113',0,1),(106,33,11,'2021-04-21 15:26:14',972,'comment','<t><p>My students like MathE platform, they find it very helpful for preparing to exams.</p> </t>',NULL,NULL,NULL,NULL,'141.101.99.26',0,1),(107,17,3,'2021-04-23 14:45:49',43,'comment','<t><p>The self-need assessment is a great opportunity to learn math by a different way, more dynamic and pleasant than the traditional methods.  Through this tool and other mathE resources it is possible to help to increase the students interest on the math subject.</p> </t>',NULL,NULL,NULL,NULL,'108.162.229.55',0,1),(108,26,6,'2021-04-23 15:07:53',43,'comment','<t><p>I think the TiEE will be excellent to share experience and reflections about the developement of new forms to teach and to learn. In the pandemic scenario, we were forced to adapt to remote education, however many teachers and students were not prepared for this drastic change. Thus, discussing experiences regarding online education tools will be of great importance for everyone involved in the current educational context.</p></t>',NULL,NULL,NULL,NULL,'141.101.69.238',0,1),(109,39,1,'2021-04-26 11:24:47',35,'comment','<r><p>I just came across this new title from Oxford University Press. I wonder if any of you have used it yet? <br/>\n<URL url=\"https://global.oup.com/ukhe/product/foundations-of-science-mathematics-ocp-2e-9780198797548?cc=ie&amp;lang=en\">https://global.oup.com/ukhe/product/foundations-of-science-mathematics-ocp-2e-9780198797548?cc=ie&amp;lang=en</URL>&amp;</p>\n</r>',NULL,NULL,NULL,NULL,'141.101.99.154',0,1),(110,40,1,'2021-04-28 09:37:42',43,'comment','<t><p>Many times, is very hard to motivate students about the importance of mathematics studies in their lives. More than complex numbers and formulations, that at first sight do not arouse much enthusiasm, mathematics can be seen as a different way of seeing the world. In this sense, many books and movies can help to awaken or further increase the interest to know the world behind mathematics.<br/>\n\'\'The Parrot\'s Theorem\'\', written by Denis Guedj, is an example of a remarkable book. From this book, I discovered many interesting episodes of math story. I recommend it for anyone that is looking for a different perspective of math story. Likewise, I recommend \'\'The Signal and the Noise\'\', written by Nate Silver, for those interested in knowing mathematical models. Several mathematical models are presented in this book through non-numerical and interesting explanations.<br/>\nIf anyone has any interesting book and/or movie suggestions, you can share them with us here.</p></t>',NULL,NULL,NULL,NULL,'108.162.229.121',0,1),(111,26,7,'2021-04-30 10:09:06',983,'comment','<t><p>The pandemic scenario has undoubtedly reinforced the need for online learning and sharing and this conference seems to be a great opportunity for those who wish to share their mathematical experiences and knowledge. I will certainly participate and share with colleagues.</p></t>',NULL,NULL,NULL,NULL,'141.101.76.91',0,1),(112,26,8,'2021-04-30 10:15:57',982,'comment','<t><p>Due to the situation, we find ourselves in, I find it interesting and necessary to adapt conferences to the online format because they are ways to share and increase knowledge, share experiences, among others. To do so, I noticed the contents that will be covered in the OL2A Conference and found them very interesting, which left me very captivated to participate and share with more colleagues!</p></t>',NULL,NULL,NULL,NULL,'172.68.102.127',0,1),(113,17,4,'2021-04-30 10:38:11',982,'comment','<t><p>I found MathE a very interesting tool in supporting students in various areas of mathematics, mainly because at the end of each evaluation has explanations of the incorrect exercises explaining how the correct answer would arrive, it is an added value in studies and understanding the subjects that have the most difficulties.</p> </t>',NULL,NULL,NULL,NULL,'172.68.102.159',0,1),(114,24,5,'2021-05-05 08:07:23',980,'comment','<t><p>This very interesting, especially in this period to use digital resources is essential</p> \n</t>',NULL,NULL,NULL,NULL,'162.158.111.182',0,1),(115,23,5,'2021-05-05 08:11:24',980,'comment','<t><p>It is very useful to have toolkit to deal with learning disabilities in Mathematics, also for the University level courses</p>\n</t>',NULL,NULL,NULL,NULL,'162.158.111.182',0,1),(116,36,2,'2021-05-05 08:13:08',980,'comment','<t><p>Very interesting paper!</p>\n</t>',NULL,NULL,NULL,NULL,'162.158.111.181',0,1),(117,35,4,'2021-05-13 08:43:31',21,'comment','<r><p>I have used a couple of number of methods this year.<br/>\nOne was using current affairs issues as a point of interest and identifying the maths aspects on that. So for statistics I used a few methods -  Covid 19 reports on spread, vaccination levels etc. looking at employment levels, income etc. We also looked at some nice national infographics and looked at the Statistics presented there <URL url=\"https://www.cso.ie/en/releasesandpublications/ep/p-heo/highereducationoutcomes-graduationyears2010-2016/\">https://www.cso.ie/en/releasesandpublications/ep/p-heo/highereducationoutcomes-graduationyears2010-2016/</URL><br/>\nUsing other areas of Maths we used internationally known building posing \"How would you?\" questions - calculate areas, quantities of construction materials required, heating volumes, heat loss levels,  - this approach was used to strike up debate and enquiry.</p> </r>',NULL,NULL,NULL,NULL,'141.101.99.228',0,1),(118,17,5,'2021-05-13 08:45:34',21,'comment','<t><p>Students liked being able to work independently on the platform and test their abilities before and after a topic was addressed</p></t>',NULL,NULL,NULL,NULL,'141.101.99.228',0,1),(119,38,2,'2021-05-13 08:50:32',21,'comment','<t><p>I think that is really good. The more relevant we can make maths to students the more they will engage with it. I always try to start a topic with what it is relevant, where do you see this in real life rather than just leaving it as \"this is a topic that must be completed as part of your studies\".If the relevance of the maths engages or impacts the student the more they are engaged with it.</p> </t>',NULL,NULL,NULL,NULL,'141.101.99.228',0,1),(120,37,2,'2021-05-13 08:54:15',21,'comment','<r><p>There are a couple of sites that let you download isometric graph paper that are useful:<br/>\n<URL url=\"https://www.waterproofpaper.com/graph-paper/isometric-paper.shtml\">https://www.waterproofpaper.com/graph-paper/isometric-paper.shtml</URL><br/>\n<URL url=\"https://free-printable-paper.com/isometric-graph-paper/\">https://free-printable-paper.com/isometric-graph-paper/</URL></p></r>',NULL,NULL,NULL,NULL,'141.101.99.228',0,1),(121,17,6,'2021-05-21 10:07:43',980,'comment','<t><p>I believe it is very useful for students with difficulties to have such a Platform at disposal!</p></t>',NULL,NULL,NULL,NULL,'162.158.94.125',0,1),(122,23,6,'2021-05-21 11:07:36',989,'comment','<r><p>It could be interesting, in order to have a retrospective view of the topic, the article \"Explores research about MLD in Mathematics Education over the past ten years\". Here <URL url=\"https://www.sciencedirect.com/science/article/abs/pii/S0732312320300717\">https://www.sciencedirect.com/science/article/abs/pii/S0732312320300717</URL></p>\n</r>',NULL,NULL,NULL,NULL,'108.162.229.101',0,1),(123,23,7,'2021-05-21 11:11:15',989,'comment','<r><p>@<EMAIL email=\"perego@dima.unige.it\">perego@dima.unige.it</EMAIL>#50 <br/>\nThis could be interesting ... <URL url=\"https://www.researchgate.net/publication/309091887_Designing_Innovative_Learning_Activities_to_Face_Difficulties_in_Algebra_of_Dyscalculic_Students_Exploiting_the_Functionalities_of_AlNuSet\">https://www.researchgate.net/publication/309091887_Designing_Innovative_Learning_Activities_to_Face_Difficulties_in_Algebra_of_Dyscalculic_Students_Exploiting_the_Functionalities_of_AlNuSet</URL></p></r>',NULL,NULL,'2021-05-21 11:11:28',989,'172.68.63.138',0,1),(124,23,8,'2021-05-21 11:11:56',989,'comment','<r><p>@<EMAIL email=\"perego@dima.unige.it\">perego@dima.unige.it</EMAIL>#50 <br/>\nThis could be interesting: <URL url=\"https://www.researchgate.net/publication/309091887_Designing_Innovative_Learning_Activities_to_Face_Difficulties_in_Algebra_of_Dyscalculic_Students_Exploiting_the_Functionalities_of_AlNuSet\">https://www.researchgate.net/publication/309091887_Designing_Innovative_Learning_Activities_to_Face_Difficulties_in_Algebra_of_Dyscalculic_Students_Exploiting_the_Functionalities_of_AlNuSet</URL></p></r>',NULL,NULL,NULL,NULL,'172.68.63.138',0,1),(125,38,3,'2021-05-25 10:02:14',23,'comment','<t><p>In my experience there are also students who prefer maths in itself without looking at the implications in the real life. I personally don\'t belong to this group, and I don\'t know how common this attitude is... I wonder whether a slightly different teaching style would be more efficient with these students?</p> </t>',NULL,NULL,NULL,NULL,'162.158.89.10',0,1),(126,41,1,'2021-05-25 10:08:10',23,'comment','<r><p>An interesting video on active learning: <URL url=\"https://www.youtube.com/watch?v=Z9orbxoRofI\">https://www.youtube.com/watch?v=Z9orbxoRofI</URL></p>\n\n<p>Here\'s some additional material <URL url=\"https://citeseerx.ist.psu.edu/viewdoc/download?doi=10.1.1.457.3304&amp;rep=rep1&amp;type=pdf\">https://citeseerx.ist.psu.edu/viewdoc/download?doi=10.1.1.457.3304&amp;rep=rep1&amp;type=pdf</URL></p>\n</r>',NULL,NULL,NULL,NULL,'162.158.92.149',0,1),(127,23,9,'2021-05-26 13:46:40',21,'comment','<t><p>This is a very interesting project and article</p></t>',NULL,NULL,NULL,NULL,'162.158.155.11',0,1),(128,41,2,'2021-05-26 13:52:46',21,'comment','<r><p>I came across this link as well, about 30 min but very informative.<br/>\n<URL url=\"https://www.bing.com/videos/search?q=active+learning&amp;&amp;view=detail&amp;mid=D593D2CE6DAC17C4B9B0D593D2CE6DAC17C4B9B0&amp;&amp;FORM=VRDGAR&amp;ru=%2Fvideos%2Fsearch%3Fq%3Dactive%2Blearning%26FORM%3DHDRSC4\">https://www.bing.com/videos/search?q=active+learning&amp;&amp;view=detail&amp;mid=D593D2CE6DAC17C4B9B0D593D2CE6DAC17C4B9B0&amp;&amp;FORM=VRDGAR&amp;ru=%2Fvideos%2Fsearch%3Fq%3Dactive%2Blearning%26FORM%3DHDRSC4</URL></p></r>',NULL,NULL,NULL,NULL,'162.158.155.11',0,1),(129,24,6,'2021-05-26 14:03:23',21,'comment','<r><p>Liked this video on the value of learning Maths<br/>\n<URL url=\"https://www.bing.com/videos/search?q=Learning+Calculus&amp;&amp;view=detail&amp;mid=283AD71B757DBB54A455283AD71B757DBB54A455&amp;&amp;FORM=VRDGAR&amp;ru=%2Fvideos%2Fsearch%3Fq%3DLearning%2BCalculus%26FORM%3DVDMHRS\">https://www.bing.com/videos/search?q=Learning+Calculus&amp;&amp;view=detail&amp;mid=283AD71B757DBB54A455283AD71B757DBB54A455&amp;&amp;FORM=VRDGAR&amp;ru=%2Fvideos%2Fsearch%3Fq%3DLearning%2BCalculus%26FORM%3DVDMHRS</URL></p></r>',NULL,NULL,NULL,NULL,'141.101.104.240',0,1),(130,24,7,'2021-05-26 16:47:14',988,'comment','<t><p>Very interesting video, thank you for sharing!</p>\n</t>',NULL,NULL,NULL,NULL,'141.101.105.142',0,1),(131,36,3,'2021-05-26 16:59:36',988,'comment','<r><p>I also recommend the proceedings of the INDRUM meetings - INDRUM is an european network of resarchers in math education at university level</p>\n\n<p><URL url=\"https://hal.archives-ouvertes.fr/INDRUM/page/indrum-proceedings\">https://hal.archives-ouvertes.fr/INDRUM/page/indrum-proceedings</URL></p>\n</r>',NULL,NULL,NULL,NULL,'162.158.111.218',0,1),(132,36,4,'2021-05-26 17:12:05',988,'comment','<r><p>An interesting paper on the way mathematics teachers describe the learning of mathematics: \"Learning Mathematics is a Journey, Doing Mathematics is Work, Mathematics is Discovery, and Presenting Mathematics is a Story\". What do you think?</p>\n\n<p><URL url=\"https://link.springer.com/article/10.1007/s10649-020-09968-x\">https://link.springer.com/article/10.1007/s10649-020-09968-x</URL></p></r>',NULL,NULL,NULL,NULL,'141.101.105.103',0,1),(133,36,5,'2021-05-27 11:39:25',35,'comment','<r><p>@<EMAIL email=\"fflor@ipb.pt\">fflor@ipb.pt</EMAIL>#100 I juts tried to access the link and it is saying \'paper not found\'</p>\n</r>',NULL,NULL,NULL,NULL,'108.162.229.101',0,1),(134,42,1,'2021-05-27 11:46:26',35,'comment','<r><p>Just came across this very interesting article sharing information on some tried and tested tools for on-line teaching #on-linetools #simulation #software #visualisation <URL url=\"https://medium.com/however-mathematics/13-beautiful-tools-to-enhance-online-teaching-and-learning-skills-b7d6ab81be01\">https://medium.com/however-mathematics/13-beautiful-tools-to-enhance-online-teaching-and-learning-skills-b7d6ab81be01</URL></p></r>','2021-08-24 10:23:26',35,NULL,NULL,'108.162.229.59',0,1),(135,43,1,'2021-05-27 11:49:50',35,'comment','<r><p>Has anyone tried this free on-line graphing tool? It seems to have very good reviews from teachers and students. <URL url=\"url\"><s>[</s>https://www.desmos.com/<e>](url)</e></URL> #graphing tools</p></r>',NULL,NULL,NULL,NULL,'108.162.229.101',0,1),(136,41,3,'2021-06-01 06:32:08',23,'comment','<t><p>Thanks! Unfortunately I always have the feeling that these non-standard teaching styles require a lot of additional preparation time for a tiny improvement of the students\' learning... but this is just a personal feeling, perhaps things are very different. I find it hard to measure though...</p></t>',NULL,NULL,NULL,NULL,'162.158.93.46',0,1),(137,43,2,'2021-06-08 10:01:32',990,'comment','<r><p>Have been using a little with my first year students - both for me to show graphs and create some simple activities, and for students to use the app to graph functions and check answers. Here is a 3-min video introduction I made a few years ago: <URL url=\"https://youtu.be/LlyCjFAjJaI\"><s>[</s>https://youtu.be/LlyCjFAjJaI<e>](https://youtu.be/LlyCjFAjJaI)</e></URL></p>\n\n<p>If interested, happy to share some Desmos examples that anyone can copy and customise</p>\n</r>',NULL,NULL,NULL,NULL,'172.69.55.197',0,1),(138,44,1,'2021-06-09 17:08:04',95,'comment','<r><p>I just came across this interesting article: <URL url=\"https://www.edutopia.org/article/when-teachers-overcome-math-anxiety-students-benefit\">https://www.edutopia.org/article/when-teachers-overcome-math-anxiety-students-benefit</URL></p></r>',NULL,NULL,NULL,NULL,'141.101.107.79',0,1),(139,36,6,'2021-06-09 17:14:40',95,'comment','<r><p>@<EMAIL email=\"marie.walsh@lit.ie\">marie.walsh@lit.ie</EMAIL>#133 Try again, I can read it!</p> \n</r>',NULL,NULL,NULL,NULL,'162.158.159.69',0,1),(140,36,7,'2021-06-09 17:15:10',95,'comment','<r><p>@<EMAIL email=\"morselli@dima.unige.it\">morselli@dima.unige.it</EMAIL>#132 It is very interesting!</p> </r>',NULL,NULL,NULL,NULL,'162.158.159.69',0,1),(141,43,3,'2021-06-10 11:13:46',35,'comment','<t><p>Thanks Damien. I\'m sure others will find this useful. Also great to get the video demo!</p> </t>',NULL,NULL,NULL,NULL,'141.101.69.164',0,1),(142,17,7,'2021-06-10 11:16:05',35,'comment','<t><p>The platform has been a great support for students. We do find that some more basic level Maths would also be helpful #refresher #revision #basic topics</p></t>',NULL,NULL,NULL,NULL,'108.162.229.19',0,1),(143,40,2,'2021-06-10 11:21:37',35,'comment','<r><p>A Beautiful Mind has maths as a backdrop but it may be a bit \'dark\' for some students(<URL url=\"https://en.wikipedia.org/wiki/A_Beautiful_Mind_%28film%29\">https://en.wikipedia.org/wiki/A_Beautiful_Mind_(film)</URL>)</p> </r>',NULL,NULL,NULL,NULL,'141.101.76.143',0,1),(144,23,10,'2021-06-10 11:24:39',35,'comment','<r><p>There may be some helpful information here [<URL url=\"https://www.nctm.org/Research-and-Advocacy/Research-Brief-and-Clips/Learning-Difficulties-in-Mathematics/\">https://www.nctm.org/Research-and-Advocacy/Research-Brief-and-Clips/Learning-Difficulties-in-Mathematics/</URL>]</p></r>',NULL,NULL,NULL,NULL,'141.101.76.143',0,1),(145,23,11,'2021-06-10 11:26:59',35,'comment','<r><p>There are interesting classifications of sub-types of Mathematical Learning Difficulties in this paper (<URL url=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC3918643/\">https://www.ncbi.nlm.nih.gov/pmc/articles/PMC3918643/</URL>)</p></r>',NULL,NULL,NULL,NULL,'141.101.104.40',0,1),(146,45,1,'2021-06-10 14:43:18',988,'comment','<r><p>Higher Mathematics Education<br/>\nA very interesting chapter on higher education.<br/>\n<URL url=\"https://link.springer.com/chapter/10.1007/978-94-009-1465-0_19\"><s>[</s>https://link.springer.com/chapter/10.1007/978-94-009-1465-0_19<e>](https://link.springer.com/chapter/10.1007/978-94-009-1465-0_19)</e></URL></p>\n</r>','2021-06-11 09:01:47',19,NULL,NULL,'162.158.92.149',0,1),(147,46,1,'2021-06-10 14:49:34',988,'comment','<t><p>This is the link to a very interesting special issue on teaching maths at university level. Some papers, although 15 years old, are still very relevant for research in the files. I recomment the paper by Anne Selden for an overview, and the paper by Liljedahl for the interesting perspective on affect</p></t>',NULL,NULL,NULL,NULL,'162.158.91.108',0,1),(148,46,2,'2021-06-10 14:50:02',988,'comment','<r><p>The link:<br/>\n<URL url=\"https://www.tandfonline.com/toc/tmes20/36/2-3?nav=tocList\"><s>[</s>https://www.tandfonline.com/toc/tmes20/36/2-3?nav=tocList<br/>\n<e>](https://www.tandfonline.com/toc/tmes20/36/2-3?nav=tocList)</e></URL></p>\n</r>',NULL,NULL,NULL,NULL,'162.158.91.108',0,1),(149,47,1,'2021-06-11 09:13:23',19,'comment','<r><p>BraganaMat 2021 is a virtual event that will happen on June 12, 2021. In this event MathE will be presented at 12h15 CET.</p>\n<UPL-FILE content=\"bragancamat-2021-programa.pdf\" size=\"2MB\" uuid=\"bcbcda5c-f052-4241-b8ed-29b9c066d88a\"><s>[upl-file uuid=bcbcda5c-f052-4241-b8ed-29b9c066d88a size=2MB]</s>bragancamat-2021-programa.pdf<e>[/upl-file]</e></UPL-FILE>\n\n</r>',NULL,NULL,NULL,NULL,'172.68.102.194',0,1),(150,47,2,'2021-06-11 09:24:01',19,'discussionTagged','[[16],[16,78]]',NULL,NULL,NULL,NULL,NULL,0,1),(151,26,9,'2021-06-11 09:24:16',19,'discussionTagged','[[16,45],[16,45,78]]',NULL,NULL,NULL,NULL,NULL,0,1),(152,45,2,'2021-06-11 09:24:54',19,'discussionRenamed','[\"Chapter\",\"Higher Mathematics Education Chapter\"]',NULL,NULL,NULL,NULL,NULL,0,1),(153,46,3,'2021-06-11 09:25:24',19,'discussionTagged','[[16],[16,40]]',NULL,NULL,NULL,NULL,NULL,0,1),(154,47,3,'2021-06-12 11:53:15',19,'comment','<r><p>Images of BraganaMat 2021!</p>\n\n<UPL-IMAGE content=\"inicio-primeira-pagina.png\" size=\"575kB\" url=\"http://localhost/mathe/teacher-forum/public/assets/files/2021-06-12/1623498746-831653-inicio-primeira-